answer_a:
Sure, here's an example of a React popup component that can be used as a module:
```jsx
import React from 'react';

const Popup = ({ isOpen, onClose, children }) => {
  return (
    <div className="popup">
      {isOpen ? (
        <button onClick={onClose}>Close</button>
      ) : (
        {children}
      )}
    </div>
  );
};

export default Popup;
```
This component accepts the following props:

* `isOpen`: A boolean value that determines whether the popup is open or closed.
* `onClose`: A function that is called when the "Close" button is clicked.
* `children`: The content of the popup.

The component renders a button with the "Close" label if `isOpen` is `true`, and the `children` otherwise. When the button is clicked, the `onClose` function is called.

To use this component, you can import it into your module and use it like this:
```jsx
import React from 'react';
import Popup from './Popup';

const MyComponent = () => {
  const [isOpen, setIsOpen] = React.useState(false);

  const handleClose = () => {
    setIsOpen(false);
  };

  return (
    <>
      <Popup isOpen={isOpen} onClose={handleClose}>
        <h1>Hello, world!</h1>
      </Popup>
      <button onClick={handleClose}>Open popup</button>
    </>
  );
};

export default MyComponent;
```
In this example, we use the `Popup` component to render a popup that can be opened and closed by clicking the button. The `isOpen` state determines whether the popup is visible or hidden, and the `onClose` function is called when the popup is closed.

answer_b:
Sure, here's an example of a simple popup component in React:


```javascript
import React, { useState } from 'react';
import { Button, Modal, Typography } from '@material-ui/core';

const App = () => {
  const [showModal, setShowModal] = useState(false);

  const handleCloseModal = () => {
    setShowModal(false);
  };

  const handleOpenModal = () => {
    setShowModal(true);
  };

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-3">
          <Button variant="contained" onClick={handleCloseModal}>
            Close Modal
          </Button>
        </div>
        <div className="col-md-3">
          <Button variant="contained" onClick={handleOpenModal}>
            Open Modal
          </Button>
        </div>
        <div className="col-md-3">
          <Modal
            show={showModal}
            onClose={handleCloseModal}
            disableScroll={true}
            size="lg"
          >
            <Typography variant="h6" align="center" gutterBottom>
              Welcome to my popup
            </Typography>
          </Modal>
        </div>
      </div>
    </div>
  );
};

export default App;

```

This component uses the `` Modal `` component from the Material-UI library to create a modal popup. The `` show `` prop is set to `` false `` by default, and is changed to `` true `` when the "Open Modal" button is clicked. When the "Close Modal" button is clicked, the `` show `` prop is set to `` false ``. The `` disableScroll `` prop prevents default browser behavior when the modal is open. The `` size="lg" `` prop sets the size of the modal to large.

You can also customize the appearance of the popup by modifying the styles in the `` styles.js `` file.

