Sure, here's an example of a Svelte login component that uses the `` axios `` library to make an HTTP request to the `` https://mydomain.com/api/login `` endpoint:


```
<script lang="ts">
  export const Login = ({ onSuccess, onFailure }) => {
    const defaultValues = {
      username: '',
      password: ''
    };

    const login = async () => {
      try {
        const response = await axios.post(`https://mydomain.com/api/login`, defaultValues);
        onSuccess(response);
      }
      catch (error) {
        onFailure(error);
      }
    };

    return (
      <div>
        <h2>Login</h2>
        <form on:submit={login}>
          <label>Username:</label>
          <input type="text" name="username" value={defaultValues.username} />

          <label>Password:</label>
          <input type="password" name="password" value={defaultValues.password} />

          <button type="submit">Login</button>
        </form>
      </div>
    );
  };
</script>

```

In this code, we're using the `` axios `` library to make a `` POST `` request to the `` https://mydomain.com/api/login `` endpoint with the `` defaultValues `` object as the payload. The `` onSuccess `` and `` onFailure `` functions are used to handle the response from the server.

Note that you'll need to replace `` mydomain.com `` with the actual domain of your API. You'll also need to install the `` axios `` library in your Svelte project before running it.

