//svelte template

<script>
  import axios from 'axios';

  export let username;
  export let password;
  export let remember;
  export let btnSubmit;

  function logIn(e) {
    e.preventDefault();

    let userdata = {
      username: username,
      password: password,
      remember: remember,
      btnSubmit: btnSubmit
    };

    axios.post('https://mydomain/com/api/login', userdata)
     .then(response => {
        console.log(response.data);
        // set the value of username and redirect to dashboard
        username = response.data.username;
        window.location.href = "dashboard";
      })
     .catch(error => {
        console.log(error);
      });
  }

  // attach logIn handler to the form
  form onsubmit={logIn}

  // render the form
  render() {
    return (
      <form onSubmit={logIn}>
        <label>
          Username:
          <input type="text" name="username"/>
        </label>
        <label>
          Password:
          <input type="password" name="password"/>
        </label>
        <input type="checkbox" name="remember" checked={remember} />
        <button type="submit">Submit</button>
      </form>
    );
  }
</script>

//svelte code

