answer_a:
Sure, here's the HTML and JavaScript for a multiple choice quiz on the English translations of three Russian words:

<!DOCTYPE html>
<html>
<head>
  <title> quiz</title>
  <style>
    #q {
      display: flex;
      justify-content: flex-end;
      align-items: center;
    }
    #q label {
      font-weight: bold;
    }
    #q input {
      padding: 10px;
      margin-bottom: 10px;
      border: 1px solid #ccc;
      border-radius: 5px;
    }
    #q input[type="radio"]:checked + label {
      background-color: #2196F3;
    }
  </style>
</head>
<body>
  <div id="q">
    <label for="russian"> Russian</label>
    <input type="radio" name="russian" id="russian-yes" checked>
    <label for="russian"> No</label>
    <input type="radio" name="russian" id="russian-no">
  </div>
  <script>
    const q = document.querySelector("#q");
    const options = ["russian-yes", "russian-no"];
    const radioButtons = document.querySelectorAll("input[type=radio]");
    for (let i = 0; i < radioButtons.length; i++) {
      radioButtons[i].addEventListener("change", (event) => {
        if (event.target.checked) {
          q.style.display = "flex";
          q.style.justify-content = "flex-end";
          q.style.align-items = "center";
          q.querySelector("#russian").value = options[i].value;
        } else {
          q.style.display = "none";
        }
      });
    }
  </script>
</body>
</html>

