Here is an example of a simple program in UnityC# that moves the character forward when the W key is pressed:
```
using UnityEngine;

public class MoveForward : MonoBehaviour
{
    void Update()
    {
        // Check if the W key is pressed
        if (Input.GetKeyDown(KeyCode.W))
        {
            // Move the character forward
            transform.position += transform.forward * Time.deltaTime;
        }
    }
}
```
This script must be attached to the character object in the Unity editor. The `KeyCode.W` is used to check if the W key is pressed, and if it is, the character's position is updated to move forward. The `Time.deltaTime` is used to make the movement smooth.

